module.exports = "<article><nz-affix class=\"toc-affix\" [nzOffsetTop]=\"16\">\n    <nz-anchor [nzAffix]=\"false\" nzShowInkInFixed (nzClick)=\"goLink($event)\">\n      <nz-link nzHref=\"#components-form-demo-horizontal-login\" nzTitle=\"Horizontal Login Form\"></nz-link><nz-link nzHref=\"#components-form-demo-normal-login\" nzTitle=\"Login Form\"></nz-link><nz-link nzHref=\"#components-form-demo-register\" nzTitle=\"Registration\"></nz-link><nz-link nzHref=\"#components-form-demo-advanced-search\" nzTitle=\"Advanced search\"></nz-link><nz-link nzHref=\"#components-form-demo-dynamic-form-item\" nzTitle=\"Dynamic Form Item\"></nz-link><nz-link nzHref=\"#components-form-demo-time-related-controls\" nzTitle=\"Time-related Controls\"></nz-link><nz-link nzHref=\"#components-form-demo-validate-reactive\" nzTitle=\"Reactive Forms Validation\"></nz-link><nz-link nzHref=\"#components-form-demo-validate-static\" nzTitle=\"Template-driven Forms Validation\"></nz-link><nz-link nzHref=\"#components-form-demo-coordinated\" nzTitle=\"Coordinated Controls\"></nz-link><nz-link nzHref=\"#components-form-demo-layout\" nzTitle=\"Form Layout\"></nz-link><nz-link nzHref=\"#components-form-demo-dynamic-rule\" nzTitle=\"Dynamic Rules\"></nz-link>\n    </nz-anchor>\n  </nz-affix><section class=\"markdown\">\n\t<h1>Form<span class=\"subtitle\"></span>\n\t<a class=\"edit-button\" href=\"https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/form/doc/index.en-US.md\" target=\"_blank\">\n\t\t<i nz-icon type=\"edit\"></i></a>\n</h1>\n\t<section class=\"markdown\" ngNonBindable>\n\t\t<p>Form is used to collect, validate, and submit the user input, usually contains various form items including checkbox, radio, input, select, and etc.</p>\n<p>Form is totally based on <a href=\"https://angular.io/guide/forms#forms\">Angular Forms</a>, you can use <a href=\"https://angular.io/guide/reactive-forms#reactive-forms\">reactive forms</a> or <a href=\"https://angular.io/guide/forms#template-driven-forms\">template-driven-forms</a>.</p>\n<blockquote>\n<p>Please make sure you have read the official form document before using the component.</p>\n</blockquote>\n<h2 id=\"form\"><span>Form</span><a onclick=\"window.location.hash = 'form'\" class=\"anchor\">#</a></h2><p>You can align the controls of a <code>form</code> using the <code>layout</code> prop：</p>\n<ul>\n<li><code>horizontal</code>：to horizontally align the <code>label</code>s and controls of the fields. (Default)</li>\n<li><code>vertical</code>：to vertically align the <code>label</code>s and controls of the fields.</li>\n<li><code>inline</code>：to render form fields in one line.</li>\n</ul>\n<h3 id=\"nz-form-item\"><span>nz-form-item</span><label class=\"api-type-label component\">component</label><a onclick=\"window.location.hash = 'nz-form-item'\" class=\"anchor\">#</a></h3><p>Used to separate the item in forms, contains label(optional) and control field.</p>\n<h3 id=\"nz-form-label\"><span>nz-form-label</span><label class=\"api-type-label component\">component</label><a onclick=\"window.location.hash = 'nz-form-label'\" class=\"anchor\">#</a></h3><p>The label of the form item, optional.</p>\n<h3 id=\"nz-form-control\"><span>nz-form-control</span><label class=\"api-type-label component\">component</label><a onclick=\"window.location.hash = 'nz-form-control'\" class=\"anchor\">#</a></h3><p>A form consists of one or more form fields whose type includes input, textarea, checkbox, radio, select, tag, and more.</p>\n<pre><code class=\"lang-html\"><span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;</span>form</span> <span class=\"token attr-name\">nz-form</span><span class=\"token punctuation\">></span></span>\n  <span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;</span>nz-form-item</span><span class=\"token punctuation\">></span></span>\n    <span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;</span>nz-form-label</span> <span class=\"token attr-name\">[nzSpan]</span><span class=\"token attr-value\"><span class=\"token punctuation\">=</span><span class=\"token punctuation\">\"</span>6<span class=\"token punctuation\">\"</span></span> <span class=\"token attr-name\">nzFor</span><span class=\"token attr-value\"><span class=\"token punctuation\">=</span><span class=\"token punctuation\">\"</span>email<span class=\"token punctuation\">\"</span></span><span class=\"token punctuation\">></span></span>E-mail<span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;/</span>nz-form-label</span><span class=\"token punctuation\">></span></span>\n    <span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;</span>nz-form-control</span> <span class=\"token attr-name\">[nzSpan]</span><span class=\"token attr-value\"><span class=\"token punctuation\">=</span><span class=\"token punctuation\">\"</span>14<span class=\"token punctuation\">\"</span></span><span class=\"token punctuation\">></span></span>\n      <span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;</span>input</span> <span class=\"token attr-name\">nz-input</span> <span class=\"token attr-name\">name</span><span class=\"token attr-value\"><span class=\"token punctuation\">=</span><span class=\"token punctuation\">\"</span>email<span class=\"token punctuation\">\"</span></span> <span class=\"token attr-name\">type</span><span class=\"token attr-value\"><span class=\"token punctuation\">=</span><span class=\"token punctuation\">\"</span>email<span class=\"token punctuation\">\"</span></span> <span class=\"token attr-name\">id</span><span class=\"token attr-value\"><span class=\"token punctuation\">=</span><span class=\"token punctuation\">\"</span>email<span class=\"token punctuation\">\"</span></span><span class=\"token punctuation\">></span></span>\n    <span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;/</span>nz-form-control</span><span class=\"token punctuation\">></span></span>\n  <span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;/</span>nz-form-item</span> <span class=\"token punctuation\">></span></span>\n<span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;/</span>form</span><span class=\"token punctuation\">></span></span>\n</code></pre>\n\n\t</section>\n\t\n\t<h2>\n\t\t<span>Examples</span>\n\t\t<i nz-icon type=\"appstore\" class=\"code-box-expand-trigger\" title=\"expand all code\" (click)=\"expandAllCode()\"></i>\n\t</h2>\n</section><div nz-row [nzGutter]=\"8\">\n\t<div nz-col [nzSpan]=\"24\">\n\t\t<nz-code-box nzTitle=\"Horizontal Login Form\" [nzId]=\"'components-form-demo-horizontal-login'\" nzSelector=\"nz-demo-form-horizontal-login\" [nzLink]=\"'components-form-demo-horizontal-login'\" nzGenerateCommand=\"ng g ng-zorro-antd:form-horizontal-login -p app --name=\" nzComponentName=\"NzDemoFormHorizontalLoginComponent\" [nzCode]=\"horizontalLogin\" [nzRawCode]=\"horizontalLoginRaw\" nzIframeSource=\"null\" nzIframeHeight=\"null\" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/form/demo/horizontal-login.md'\">\n\t<nz-demo-form-horizontal-login demo></nz-demo-form-horizontal-login>\n\t<div intro ngNonBindable>\n\t\t<p>Horizontal login form is often used in navigation bar.</p>\n\n\t</div>\n</nz-code-box>\n<nz-code-box nzTitle=\"Login Form\" [nzId]=\"'components-form-demo-normal-login'\" nzSelector=\"nz-demo-form-normal-login\" [nzLink]=\"'components-form-demo-normal-login'\" nzGenerateCommand=\"ng g ng-zorro-antd:form-normal-login -p app --name=\" nzComponentName=\"NzDemoFormNormalLoginComponent\" [nzCode]=\"normalLogin\" [nzRawCode]=\"normalLoginRaw\" nzIframeSource=\"null\" nzIframeHeight=\"null\" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/form/demo/normal-login.md'\">\n\t<nz-demo-form-normal-login demo></nz-demo-form-normal-login>\n\t<div intro ngNonBindable>\n\t\t<p>Normal login form which can contain more elements.</p>\n\n\t</div>\n</nz-code-box>\n<nz-code-box nzTitle=\"Registration\" [nzId]=\"'components-form-demo-register'\" nzSelector=\"nz-demo-form-register\" [nzLink]=\"'components-form-demo-register'\" nzGenerateCommand=\"ng g ng-zorro-antd:form-register -p app --name=\" nzComponentName=\"NzDemoFormRegisterComponent\" [nzCode]=\"register\" [nzRawCode]=\"registerRaw\" nzIframeSource=\"null\" nzIframeHeight=\"null\" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/form/demo/register.md'\">\n\t<nz-demo-form-register demo></nz-demo-form-register>\n\t<div intro ngNonBindable>\n\t\t<p>Fill in this form to create a new account for you.</p>\n\n\t</div>\n</nz-code-box>\n<nz-code-box nzTitle=\"Advanced search\" [nzId]=\"'components-form-demo-advanced-search'\" nzSelector=\"nz-demo-form-advanced-search\" [nzLink]=\"'components-form-demo-advanced-search'\" nzGenerateCommand=\"ng g ng-zorro-antd:form-advanced-search -p app --name=\" nzComponentName=\"NzDemoFormAdvancedSearchComponent\" [nzCode]=\"advancedSearch\" [nzRawCode]=\"advancedSearchRaw\" nzIframeSource=\"null\" nzIframeHeight=\"null\" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/form/demo/advanced-search.md'\">\n\t<nz-demo-form-advanced-search demo></nz-demo-form-advanced-search>\n\t<div intro ngNonBindable>\n\t\t<p>Three columns layout is often used for advanced searching of data table.</p>\n<p>Because the width of label is not fixed, you may need to adjust it by customizing its style.</p>\n\n\t</div>\n</nz-code-box>\n<nz-code-box nzTitle=\"Dynamic Form Item\" [nzId]=\"'components-form-demo-dynamic-form-item'\" nzSelector=\"nz-demo-form-dynamic-form-item\" [nzLink]=\"'components-form-demo-dynamic-form-item'\" nzGenerateCommand=\"ng g ng-zorro-antd:form-dynamic-form-item -p app --name=\" nzComponentName=\"NzDemoFormDynamicFormItemComponent\" [nzCode]=\"dynamicFormItem\" [nzRawCode]=\"dynamicFormItemRaw\" nzIframeSource=\"null\" nzIframeHeight=\"null\" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/form/demo/dynamic-form-item.md'\">\n\t<nz-demo-form-dynamic-form-item demo></nz-demo-form-dynamic-form-item>\n\t<div intro ngNonBindable>\n\t\t<p>Add or remove form items dynamically.</p>\n\n\t</div>\n</nz-code-box>\n<nz-code-box nzTitle=\"Time-related Controls\" [nzId]=\"'components-form-demo-time-related-controls'\" nzSelector=\"nz-demo-form-time-related-controls\" [nzLink]=\"'components-form-demo-time-related-controls'\" nzGenerateCommand=\"ng g ng-zorro-antd:form-time-related-controls -p app --name=\" nzComponentName=\"NzDemoFormTimeRelatedControlsComponent\" [nzCode]=\"timeRelatedControls\" [nzRawCode]=\"timeRelatedControlsRaw\" nzIframeSource=\"null\" nzIframeHeight=\"null\" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/form/demo/time-related-controls.md'\">\n\t<nz-demo-form-time-related-controls demo></nz-demo-form-time-related-controls>\n\t<div intro ngNonBindable>\n\t\t<p>All the types of input and output in time-related components are <code>Date</code>. You can use <a href=\"https://date-fns.org/\">date-fns</a> to handle it.</p>\n\n\t</div>\n</nz-code-box>\n<nz-code-box nzTitle=\"Reactive Forms Validation\" [nzId]=\"'components-form-demo-validate-reactive'\" nzSelector=\"nz-demo-form-validate-reactive\" [nzLink]=\"'components-form-demo-validate-reactive'\" nzGenerateCommand=\"ng g ng-zorro-antd:form-validate-reactive -p app --name=\" nzComponentName=\"NzDemoFormValidateReactiveComponent\" [nzCode]=\"validateReactive\" [nzRawCode]=\"validateReactiveRaw\" nzIframeSource=\"null\" nzIframeHeight=\"null\" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/form/demo/validate-reactive.md'\">\n\t<nz-demo-form-validate-reactive demo></nz-demo-form-validate-reactive>\n\t<div intro ngNonBindable>\n\t\t<p>We provide properties like <code>nzValidateStatus</code> <code>nzHasFeedback</code> in <code>nz-form-control</code> to customize your own validate status and message, when using <a href=\"https://angular.io/guide/reactive-forms#reactive-forms\">reactive forms</a>.</p>\n<ol>\n<li><code>nzValidateStatus</code>: validate status of form components, the default status comes from the <code>NgControl</code> in <code>nz-form-control</code>, you can set other <code>NgControl</code> to it.</li>\n<li><code>nzHasFeedback</code>: display feed icon of input control</li>\n<li><code>nz-form-explain</code>: display validate message.</li>\n</ol>\n\n\t</div>\n</nz-code-box>\n<nz-code-box nzTitle=\"Template-driven Forms Validation\" [nzId]=\"'components-form-demo-validate-static'\" nzSelector=\"nz-demo-form-validate-static\" [nzLink]=\"'components-form-demo-validate-static'\" nzGenerateCommand=\"ng g ng-zorro-antd:form-validate-static -p app --name=\" nzComponentName=\"NzDemoFormValidateStaticComponent\" [nzCode]=\"validateStatic\" [nzRawCode]=\"validateStaticRaw\" nzIframeSource=\"null\" nzIframeHeight=\"null\" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/form/demo/validate-static.md'\">\n\t<nz-demo-form-validate-static demo></nz-demo-form-validate-static>\n\t<div intro ngNonBindable>\n\t\t<p>We provide properties like <code>nzValidateStatus</code> <code>nzHasFeedback</code> in <code>nz-form-control</code> to customize your own validate status and message, when using <a href=\"https://angular.io/guide/forms#template-driven-forms\">template-driven forms</a>.</p>\n<ol>\n<li><code>nzValidateStatus</code>: validate status of form components which could be &#39;success&#39;, &#39;warning&#39;, &#39;error&#39;, &#39;validating&#39;.</li>\n<li><code>nzHasFeedback</code>: display feed icon of input control</li>\n<li><code>nz-form-explain</code>: display validate message.</li>\n</ol>\n\n\t</div>\n</nz-code-box>\n<nz-code-box nzTitle=\"Coordinated Controls\" [nzId]=\"'components-form-demo-coordinated'\" nzSelector=\"nz-demo-form-coordinated\" [nzLink]=\"'components-form-demo-coordinated'\" nzGenerateCommand=\"ng g ng-zorro-antd:form-coordinated -p app --name=\" nzComponentName=\"NzDemoFormCoordinatedComponent\" [nzCode]=\"coordinated\" [nzRawCode]=\"coordinatedRaw\" nzIframeSource=\"null\" nzIframeHeight=\"null\" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/form/demo/coordinated.md'\">\n\t<nz-demo-form-coordinated demo></nz-demo-form-coordinated>\n\t<div intro ngNonBindable>\n\t\t<p>Use <code>setValue</code> to set other control&#39;s value programmaticly.</p>\n\n\t</div>\n</nz-code-box>\n<nz-code-box nzTitle=\"Form Layout\" [nzId]=\"'components-form-demo-layout'\" nzSelector=\"nz-demo-form-layout\" [nzLink]=\"'components-form-demo-layout'\" nzGenerateCommand=\"ng g ng-zorro-antd:form-layout -p app --name=\" nzComponentName=\"NzDemoFormLayoutComponent\" [nzCode]=\"layout\" [nzRawCode]=\"layoutRaw\" nzIframeSource=\"null\" nzIframeHeight=\"null\" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/form/demo/layout.md'\">\n\t<nz-demo-form-layout demo></nz-demo-form-layout>\n\t<div intro ngNonBindable>\n\t\t<p>There are three layout for form: <code>horizontal</code>, <code>vertical</code>, <code>inline</code>.</p>\n\n\t</div>\n</nz-code-box>\n<nz-code-box nzTitle=\"Dynamic Rules\" [nzId]=\"'components-form-demo-dynamic-rule'\" nzSelector=\"nz-demo-form-dynamic-rule\" [nzLink]=\"'components-form-demo-dynamic-rule'\" nzGenerateCommand=\"ng g ng-zorro-antd:form-dynamic-rule -p app --name=\" nzComponentName=\"NzDemoFormDynamicRuleComponent\" [nzCode]=\"dynamicRule\" [nzRawCode]=\"dynamicRuleRaw\" nzIframeSource=\"null\" nzIframeHeight=\"null\" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/form/demo/dynamic-rule.md'\">\n\t<nz-demo-form-dynamic-rule demo></nz-demo-form-dynamic-rule>\n\t<div intro ngNonBindable>\n\t\t<p>Perform different check rules according to different situations.</p>\n\n\t</div>\n</nz-code-box>\n\n\t</div>\n</div><section class=\"markdown api-container\" ngNonBindable><h2 id=\"api\"><span>API</span><a onclick=\"window.location.hash = 'api'\" class=\"anchor\">#</a></h2><h3 id=\"form\"><span>Form</span><a onclick=\"window.location.hash = 'form'\" class=\"anchor\">#</a></h3><table>\n<thead>\n<tr>\n<th>Property</th>\n<th>Description</th>\n<th>Type</th>\n<th>Default Value</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td><code>[nzLayout]</code></td>\n<td>Form layout</td>\n<td><code>&#39;horizontal&#39;丨&#39;vertical&#39;丨&#39;inline&#39;</code></td>\n<td>&#39;horizontal&#39;</td>\n</tr>\n</tbody>\n</table>\n<h3 id=\"nz-form-item\"><span>nz-form-item</span><label class=\"api-type-label component\">component</label><a onclick=\"window.location.hash = 'nz-form-item'\" class=\"anchor\">#</a></h3><p>Used to separate the item in forms, contains label(optional) and control field.</p>\n<blockquote>\n<p>All api in <a href=\"/components/grid/zh\">nz-row</a> can be used in <code>nz-form-item</code>.</p>\n</blockquote>\n<table>\n<thead>\n<tr>\n<th>Property</th>\n<th>Description</th>\n<th>Type</th>\n<th>Default Value</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td><code>[nzFlex]</code></td>\n<td>display flex</td>\n<td>boolean</td>\n<td>false</td>\n</tr>\n</tbody>\n</table>\n<h3 id=\"nz-form-label\"><span>nz-form-label</span><label class=\"api-type-label component\">component</label><a onclick=\"window.location.hash = 'nz-form-label'\" class=\"anchor\">#</a></h3><p>The label of the form item, optional.</p>\n<blockquote>\n<p>All api in <a href=\"/components/grid/zh\">nz-col</a> can be used in <code>nz-form-label</code>.</p>\n</blockquote>\n<table>\n<thead>\n<tr>\n<th>Property</th>\n<th>Description</th>\n<th>Type</th>\n<th>Default Value</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td><code>[nzRequired]</code></td>\n<td>add required style to current item</td>\n<td>boolean</td>\n<td>false</td>\n</tr>\n<tr>\n<td><code>[nzFor]</code></td>\n<td>The <code>for</code> property of <code>label</code></td>\n<td>string</td>\n<td>-</td>\n</tr>\n</tbody>\n</table>\n<h3 id=\"nz-form-control\"><span>nz-form-control</span><label class=\"api-type-label component\">component</label><a onclick=\"window.location.hash = 'nz-form-control'\" class=\"anchor\">#</a></h3><p>A form consists of one or more form fields whose type includes input, textarea, checkbox, radio, select, tag, and more.</p>\n<blockquote>\n<p>All api in <a href=\"/components/grid/zh\">nz-col</a> can be used in <code>nz-form-control</code>.</p>\n</blockquote>\n<table>\n<thead>\n<tr>\n<th>Property</th>\n<th>Description</th>\n<th>Type</th>\n<th>Default Value</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td><code>[nzValidateStatus]</code>(Reactive Forms)</td>\n<td>Will generate status based on FormControl</td>\n<td>FormControl</td>\n<td>first <code>FormControl</code> in <code>nz-form-control</code></td>\n</tr>\n<tr>\n<td><code>[nzValidateStatus]</code>(Template-driven Forms)</td>\n<td>The validation status. options：&#39;success&#39; &#39;warning&#39; &#39;error&#39; &#39;validating&#39;</td>\n<td>string</td>\n<td></td>\n</tr>\n<tr>\n<td><code>[nzHasFeedback]</code></td>\n<td>Used with <code>nzValidateStatus</code>, this option specifies the validation status icon. Recommended to be used only with <code>Input</code>.</td>\n<td>boolean</td>\n<td>false</td>\n</tr>\n</tbody>\n</table>\n<h3 id=\"nz-form-explain\"><span>nz-form-explain</span><label class=\"api-type-label component\">component</label><a onclick=\"window.location.hash = 'nz-form-explain'\" class=\"anchor\">#</a></h3><p>Validation messages</p>\n<h3 id=\"nz-form-extra\"><span>nz-form-extra</span><label class=\"api-type-label component\">component</label><a onclick=\"window.location.hash = 'nz-form-extra'\" class=\"anchor\">#</a></h3><p>The extra prompt message. It is similar to help.</p>\n<h3 id=\"nz-form-split\"><span>nz-form-split</span><label class=\"api-type-label component\">component</label><a onclick=\"window.location.hash = 'nz-form-split'\" class=\"anchor\">#</a></h3><p>The split icon of <code>-</code></p>\n<h3 id=\"nz-form-text\"><span>nz-form-text</span><label class=\"api-type-label component\">component</label><a onclick=\"window.location.hash = 'nz-form-text'\" class=\"anchor\">#</a></h3><p>Text in <code>nz-form-control</code></p>\n</section></article>"

