module.exports = "<article><nz-affix class=\"toc-affix\" [nzOffsetTop]=\"16\">\n    <nz-anchor [nzAffix]=\"false\" nzShowInkInFixed (nzClick)=\"goLink($event)\">\n      <nz-link nzHref=\"#components-form-demo-horizontal-login\" nzTitle=\"水平登录栏\"></nz-link><nz-link nzHref=\"#components-form-demo-normal-login\" nzTitle=\"登录框\"></nz-link><nz-link nzHref=\"#components-form-demo-register\" nzTitle=\"注册新用户\"></nz-link><nz-link nzHref=\"#components-form-demo-advanced-search\" nzTitle=\"高级搜索\"></nz-link><nz-link nzHref=\"#components-form-demo-dynamic-form-item\" nzTitle=\"动态增减表单项\"></nz-link><nz-link nzHref=\"#components-form-demo-time-related-controls\" nzTitle=\"时间类控件\"></nz-link><nz-link nzHref=\"#components-form-demo-validate-reactive\" nzTitle=\"响应式表单验证\"></nz-link><nz-link nzHref=\"#components-form-demo-validate-static\" nzTitle=\"模板驱动表单验证\"></nz-link><nz-link nzHref=\"#components-form-demo-coordinated\" nzTitle=\"表单联动\"></nz-link><nz-link nzHref=\"#components-form-demo-layout\" nzTitle=\"表单布局\"></nz-link><nz-link nzHref=\"#components-form-demo-dynamic-rule\" nzTitle=\"动态校验规则\"></nz-link>\n    </nz-anchor>\n  </nz-affix><section class=\"markdown\">\n\t<h1>Form<span class=\"subtitle\">表单</span>\n\t<a class=\"edit-button\" href=\"https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/form/doc/index.zh-CN.md\" target=\"_blank\">\n\t\t<i nz-icon type=\"edit\"></i></a>\n</h1>\n\t<section class=\"markdown\" ngNonBindable>\n\t\t<p>具有数据收集、校验和提交功能的表单，包含复选框、单选框、输入框、下拉选择框等元素。</p>\n<p>该组件需要与 <a href=\"https://angular.io/guide/forms#forms\">Angular表单</a> 结合使用，开发者根据需要可以自由选择 <a href=\"https://angular.io/guide/reactive-forms#reactive-forms\">响应式表单</a> 或 <a href=\"https://angular.io/guide/forms#template-driven-forms\">模板驱动表单</a>.</p>\n<blockquote>\n<p>使用该组件前请确保您已经阅读并掌握了 <a href=\"https://angular.io/guide/forms#forms\">Forms</a> 的使用方式。</p>\n</blockquote>\n<h2 id=\"表单\"><span>表单</span><a onclick=\"window.location.hash = '表单'\" class=\"anchor\">#</a></h2><p>我们提供了以下三种排列方式：</p>\n<ul>\n<li>水平排列：标签和表单控件水平排列；（默认）</li>\n<li>垂直排列：标签和表单控件上下垂直排列；</li>\n<li>行内排列：表单项水平行内排列。</li>\n</ul>\n<h3 id=\"表单项-nz-form-item\"><span>表单项 nz-form-item</span><a onclick=\"window.location.hash = '表单项-nz-form-item'\" class=\"anchor\">#</a></h3><p>表单项用于区分表单中不同的区域，包含表单域和表单标签(可选)。</p>\n<h3 id=\"表单标签-nz-form-label\"><span>表单标签 nz-form-label</span><a onclick=\"window.location.hash = '表单标签-nz-form-label'\" class=\"anchor\">#</a></h3><p>用于标示当前表单项的内容，可选。</p>\n<h3 id=\"表单域-nz-form-control\"><span>表单域 nz-form-control</span><a onclick=\"window.location.hash = '表单域-nz-form-control'\" class=\"anchor\">#</a></h3><p>表单一定会包含表单域，表单域可以是输入控件，标准表单域，标签，下拉菜单，文本域等。</p>\n<pre><code class=\"lang-html\"><span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;</span>form</span> <span class=\"token attr-name\">nz-form</span><span class=\"token punctuation\">></span></span>\n  <span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;</span>nz-form-item</span><span class=\"token punctuation\">></span></span>\n    <span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;</span>nz-form-label</span> <span class=\"token attr-name\">[nzSpan]</span><span class=\"token attr-value\"><span class=\"token punctuation\">=</span><span class=\"token punctuation\">\"</span>6<span class=\"token punctuation\">\"</span></span> <span class=\"token attr-name\">nzFor</span><span class=\"token attr-value\"><span class=\"token punctuation\">=</span><span class=\"token punctuation\">\"</span>email<span class=\"token punctuation\">\"</span></span><span class=\"token punctuation\">></span></span>E-mail<span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;/</span>nz-form-label</span><span class=\"token punctuation\">></span></span>\n    <span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;</span>nz-form-control</span> <span class=\"token attr-name\">[nzSpan]</span><span class=\"token attr-value\"><span class=\"token punctuation\">=</span><span class=\"token punctuation\">\"</span>14<span class=\"token punctuation\">\"</span></span><span class=\"token punctuation\">></span></span>\n      <span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;</span>input</span> <span class=\"token attr-name\">nz-input</span> <span class=\"token attr-name\">name</span><span class=\"token attr-value\"><span class=\"token punctuation\">=</span><span class=\"token punctuation\">\"</span>email<span class=\"token punctuation\">\"</span></span> <span class=\"token attr-name\">type</span><span class=\"token attr-value\"><span class=\"token punctuation\">=</span><span class=\"token punctuation\">\"</span>email<span class=\"token punctuation\">\"</span></span> <span class=\"token attr-name\">id</span><span class=\"token attr-value\"><span class=\"token punctuation\">=</span><span class=\"token punctuation\">\"</span>email<span class=\"token punctuation\">\"</span></span><span class=\"token punctuation\">></span></span>\n    <span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;/</span>nz-form-control</span><span class=\"token punctuation\">></span></span>\n  <span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;/</span>nz-form-item</span> <span class=\"token punctuation\">></span></span>\n<span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;/</span>form</span><span class=\"token punctuation\">></span></span>\n</code></pre>\n\n\t</section>\n\t\n\t<h2>\n\t\t<span>代码演示</span>\n\t\t<i nz-icon type=\"appstore\" class=\"code-box-expand-trigger\" title=\"展开全部代码\" (click)=\"expandAllCode()\"></i>\n\t</h2>\n</section><div nz-row [nzGutter]=\"8\">\n\t<div nz-col [nzSpan]=\"24\">\n\t\t<nz-code-box nzTitle=\"水平登录栏\" [nzId]=\"'components-form-demo-horizontal-login'\" nzSelector=\"nz-demo-form-horizontal-login\" [nzLink]=\"'components-form-demo-horizontal-login'\" nzGenerateCommand=\"ng g ng-zorro-antd:form-horizontal-login -p app --name=\" nzComponentName=\"NzDemoFormHorizontalLoginComponent\" [nzCode]=\"horizontalLogin\" [nzRawCode]=\"horizontalLoginRaw\" nzIframeSource=\"null\" nzIframeHeight=\"null\" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/form/demo/horizontal-login.md'\">\n\t<nz-demo-form-horizontal-login demo></nz-demo-form-horizontal-login>\n\t<div intro ngNonBindable>\n\t\t<p>水平登录栏，常用在顶部导航栏中。</p>\n\n\t</div>\n</nz-code-box>\n<nz-code-box nzTitle=\"登录框\" [nzId]=\"'components-form-demo-normal-login'\" nzSelector=\"nz-demo-form-normal-login\" [nzLink]=\"'components-form-demo-normal-login'\" nzGenerateCommand=\"ng g ng-zorro-antd:form-normal-login -p app --name=\" nzComponentName=\"NzDemoFormNormalLoginComponent\" [nzCode]=\"normalLogin\" [nzRawCode]=\"normalLoginRaw\" nzIframeSource=\"null\" nzIframeHeight=\"null\" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/form/demo/normal-login.md'\">\n\t<nz-demo-form-normal-login demo></nz-demo-form-normal-login>\n\t<div intro ngNonBindable>\n\t\t<p>普通的登录框，可以容纳更多的元素。</p>\n\n\t</div>\n</nz-code-box>\n<nz-code-box nzTitle=\"注册新用户\" [nzId]=\"'components-form-demo-register'\" nzSelector=\"nz-demo-form-register\" [nzLink]=\"'components-form-demo-register'\" nzGenerateCommand=\"ng g ng-zorro-antd:form-register -p app --name=\" nzComponentName=\"NzDemoFormRegisterComponent\" [nzCode]=\"register\" [nzRawCode]=\"registerRaw\" nzIframeSource=\"null\" nzIframeHeight=\"null\" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/form/demo/register.md'\">\n\t<nz-demo-form-register demo></nz-demo-form-register>\n\t<div intro ngNonBindable>\n\t\t<p>用户填写必须的信息以注册新用户。</p>\n\n\t</div>\n</nz-code-box>\n<nz-code-box nzTitle=\"高级搜索\" [nzId]=\"'components-form-demo-advanced-search'\" nzSelector=\"nz-demo-form-advanced-search\" [nzLink]=\"'components-form-demo-advanced-search'\" nzGenerateCommand=\"ng g ng-zorro-antd:form-advanced-search -p app --name=\" nzComponentName=\"NzDemoFormAdvancedSearchComponent\" [nzCode]=\"advancedSearch\" [nzRawCode]=\"advancedSearchRaw\" nzIframeSource=\"null\" nzIframeHeight=\"null\" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/form/demo/advanced-search.md'\">\n\t<nz-demo-form-advanced-search demo></nz-demo-form-advanced-search>\n\t<div intro ngNonBindable>\n\t\t<p>三列栅格式的表单排列方式，常用于数据表格的高级搜索。</p>\n<p>有部分定制的样式代码，由于输入标签长度不确定，需要根据具体情况自行调整。</p>\n\n\t</div>\n</nz-code-box>\n<nz-code-box nzTitle=\"动态增减表单项\" [nzId]=\"'components-form-demo-dynamic-form-item'\" nzSelector=\"nz-demo-form-dynamic-form-item\" [nzLink]=\"'components-form-demo-dynamic-form-item'\" nzGenerateCommand=\"ng g ng-zorro-antd:form-dynamic-form-item -p app --name=\" nzComponentName=\"NzDemoFormDynamicFormItemComponent\" [nzCode]=\"dynamicFormItem\" [nzRawCode]=\"dynamicFormItemRaw\" nzIframeSource=\"null\" nzIframeHeight=\"null\" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/form/demo/dynamic-form-item.md'\">\n\t<nz-demo-form-dynamic-form-item demo></nz-demo-form-dynamic-form-item>\n\t<div intro ngNonBindable>\n\t\t<p>动态增加、减少表单项。</p>\n\n\t</div>\n</nz-code-box>\n<nz-code-box nzTitle=\"时间类控件\" [nzId]=\"'components-form-demo-time-related-controls'\" nzSelector=\"nz-demo-form-time-related-controls\" [nzLink]=\"'components-form-demo-time-related-controls'\" nzGenerateCommand=\"ng g ng-zorro-antd:form-time-related-controls -p app --name=\" nzComponentName=\"NzDemoFormTimeRelatedControlsComponent\" [nzCode]=\"timeRelatedControls\" [nzRawCode]=\"timeRelatedControlsRaw\" nzIframeSource=\"null\" nzIframeHeight=\"null\" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/form/demo/time-related-controls.md'\">\n\t<nz-demo-form-time-related-controls demo></nz-demo-form-time-related-controls>\n\t<div intro ngNonBindable>\n\t\t<p>时间类组件的输入和输出类型均为 <code>Date</code> 类型，可以通过 <a href=\"https://date-fns.org/\">date-fns</a> 工具库进行进一步的处理。</p>\n\n\t</div>\n</nz-code-box>\n<nz-code-box nzTitle=\"响应式表单验证\" [nzId]=\"'components-form-demo-validate-reactive'\" nzSelector=\"nz-demo-form-validate-reactive\" [nzLink]=\"'components-form-demo-validate-reactive'\" nzGenerateCommand=\"ng g ng-zorro-antd:form-validate-reactive -p app --name=\" nzComponentName=\"NzDemoFormValidateReactiveComponent\" [nzCode]=\"validateReactive\" [nzRawCode]=\"validateReactiveRaw\" nzIframeSource=\"null\" nzIframeHeight=\"null\" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/form/demo/validate-reactive.md'\">\n\t<nz-demo-form-validate-reactive demo></nz-demo-form-validate-reactive>\n\t<div intro ngNonBindable>\n\t\t<p>我们在 <code>nz-form-control</code> 上 提供了 <code>nzValidateStatus</code> <code>nzHasFeedback</code> 等属性，当使用<a href=\"https://angular.io/guide/reactive-forms#reactive-forms\">响应式表单</a>时，可以自己定义校验的时机和内容。</p>\n<ol>\n<li><code>nzValidateStatus</code>: 校验状态，默认自动从 <code>nz-form-control</code> 中的 <code>NgControl</code> 获得校验状态，也可以手动指定为特定的 <code>NgControl</code>。</li>\n<li><code>nzHasFeedback</code>：用于给输入框添加反馈图标。</li>\n<li><code>nz-form-explain</code>：设置校验文案。</li>\n</ol>\n\n\t</div>\n</nz-code-box>\n<nz-code-box nzTitle=\"模板驱动表单验证\" [nzId]=\"'components-form-demo-validate-static'\" nzSelector=\"nz-demo-form-validate-static\" [nzLink]=\"'components-form-demo-validate-static'\" nzGenerateCommand=\"ng g ng-zorro-antd:form-validate-static -p app --name=\" nzComponentName=\"NzDemoFormValidateStaticComponent\" [nzCode]=\"validateStatic\" [nzRawCode]=\"validateStaticRaw\" nzIframeSource=\"null\" nzIframeHeight=\"null\" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/form/demo/validate-static.md'\">\n\t<nz-demo-form-validate-static demo></nz-demo-form-validate-static>\n\t<div intro ngNonBindable>\n\t\t<p>我们在 <code>nz-form-control</code> 上 提供了 <code>nzValidateStatus</code> <code>nzHasFeedback</code> 等属性，当使用<a href=\"https://angular.io/guide/forms#template-driven-forms\">模板驱动表单</a>时，可以自己定义校验的时机和内容。</p>\n<ol>\n<li><code>nzValidateStatus</code>: 校验状态，可选 &#39;success&#39;, &#39;warning&#39;, &#39;error&#39;, &#39;validating&#39;。</li>\n<li><code>nzHasFeedback</code>：用于给输入框添加反馈图标。</li>\n<li><code>nz-form-explain</code>：设置校验文案。</li>\n</ol>\n\n\t</div>\n</nz-code-box>\n<nz-code-box nzTitle=\"表单联动\" [nzId]=\"'components-form-demo-coordinated'\" nzSelector=\"nz-demo-form-coordinated\" [nzLink]=\"'components-form-demo-coordinated'\" nzGenerateCommand=\"ng g ng-zorro-antd:form-coordinated -p app --name=\" nzComponentName=\"NzDemoFormCoordinatedComponent\" [nzCode]=\"coordinated\" [nzRawCode]=\"coordinatedRaw\" nzIframeSource=\"null\" nzIframeHeight=\"null\" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/form/demo/coordinated.md'\">\n\t<nz-demo-form-coordinated demo></nz-demo-form-coordinated>\n\t<div intro ngNonBindable>\n\t\t<p>使用 <code>setValue</code> 来动态设置其他控件的值。</p>\n\n\t</div>\n</nz-code-box>\n<nz-code-box nzTitle=\"表单布局\" [nzId]=\"'components-form-demo-layout'\" nzSelector=\"nz-demo-form-layout\" [nzLink]=\"'components-form-demo-layout'\" nzGenerateCommand=\"ng g ng-zorro-antd:form-layout -p app --name=\" nzComponentName=\"NzDemoFormLayoutComponent\" [nzCode]=\"layout\" [nzRawCode]=\"layoutRaw\" nzIframeSource=\"null\" nzIframeHeight=\"null\" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/form/demo/layout.md'\">\n\t<nz-demo-form-layout demo></nz-demo-form-layout>\n\t<div intro ngNonBindable>\n\t\t<p>表单有三种布局。</p>\n\n\t</div>\n</nz-code-box>\n<nz-code-box nzTitle=\"动态校验规则\" [nzId]=\"'components-form-demo-dynamic-rule'\" nzSelector=\"nz-demo-form-dynamic-rule\" [nzLink]=\"'components-form-demo-dynamic-rule'\" nzGenerateCommand=\"ng g ng-zorro-antd:form-dynamic-rule -p app --name=\" nzComponentName=\"NzDemoFormDynamicRuleComponent\" [nzCode]=\"dynamicRule\" [nzRawCode]=\"dynamicRuleRaw\" nzIframeSource=\"null\" nzIframeHeight=\"null\" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/form/demo/dynamic-rule.md'\">\n\t<nz-demo-form-dynamic-rule demo></nz-demo-form-dynamic-rule>\n\t<div intro ngNonBindable>\n\t\t<p>根据不同情况执行不同的校验规则。</p>\n\n\t</div>\n</nz-code-box>\n\n\t</div>\n</div><section class=\"markdown api-container\" ngNonBindable><h2 id=\"api\"><span>API</span><a onclick=\"window.location.hash = 'api'\" class=\"anchor\">#</a></h2><h3 id=\"nz-form\"><span>nz-form</span><label class=\"api-type-label component\">component</label><a onclick=\"window.location.hash = 'nz-form'\" class=\"anchor\">#</a></h3><table>\n<thead>\n<tr>\n<th>参数</th>\n<th>说明</th>\n<th>类型</th>\n<th>默认值</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td><code>[nzLayout]</code></td>\n<td>表单布局</td>\n<td><code>&#39;horizontal&#39;丨&#39;vertical&#39;丨&#39;inline&#39;</code></td>\n<td>&#39;horizontal&#39;</td>\n</tr>\n</tbody>\n</table>\n<h3 id=\"nz-form-item\"><span>nz-form-item</span><label class=\"api-type-label component\">component</label><a onclick=\"window.location.hash = 'nz-form-item'\" class=\"anchor\">#</a></h3><p>表单项用于区分表单中不同的区域，包含表单域和表单标签(可选)。</p>\n<blockquote>\n<p>所有 <a href=\"/components/grid/zh\">nz-row</a> 的参数在 <code>nz-form-item</code> 上均可直接使用。</p>\n</blockquote>\n<table>\n<thead>\n<tr>\n<th>参数</th>\n<th>说明</th>\n<th>类型</th>\n<th>默认值</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td><code>[nzFlex]</code></td>\n<td>是否Flex布局</td>\n<td>boolean</td>\n<td>false</td>\n</tr>\n</tbody>\n</table>\n<h3 id=\"nz-form-label\"><span>nz-form-label</span><label class=\"api-type-label component\">component</label><a onclick=\"window.location.hash = 'nz-form-label'\" class=\"anchor\">#</a></h3><p>用于标示当前表单项的内容，可选。</p>\n<blockquote>\n<p>所有 <a href=\"/components/grid/zh\">nz-col</a> 的参数在 <code>nz-form-label</code> 上均可直接使用。</p>\n</blockquote>\n<table>\n<thead>\n<tr>\n<th>参数</th>\n<th>说明</th>\n<th>类型</th>\n<th>默认值</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td><code>[nzRequired]</code></td>\n<td>当前项是否为必填，仅影响样式</td>\n<td>boolean</td>\n<td>false</td>\n</tr>\n<tr>\n<td><code>[nzFor]</code></td>\n<td>label 标签的 for 属性</td>\n<td>string</td>\n<td>-</td>\n</tr>\n</tbody>\n</table>\n<h3 id=\"nz-form-control\"><span>nz-form-control</span><label class=\"api-type-label component\">component</label><a onclick=\"window.location.hash = 'nz-form-control'\" class=\"anchor\">#</a></h3><p>表单一定会包含表单域，表单域可以是输入控件，标准表单域，标签，下拉菜单，文本域等。</p>\n<blockquote>\n<p>所有 <a href=\"/components/grid/zh\">nz-col</a> 的参数在 <code>nz-form-control</code> 上均可直接使用。</p>\n</blockquote>\n<table>\n<thead>\n<tr>\n<th>参数</th>\n<th>说明</th>\n<th>类型</th>\n<th>默认值</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td><code>[nzValidateStatus]</code>(Reactive Forms)</td>\n<td>会根据 FormControl 的状态自动生成校验状态</td>\n<td>FormControl</td>\n<td><code>nz-form-control</code> 中包裹的第一个 <code>FormControl</code></td>\n</tr>\n<tr>\n<td><code>[nzValidateStatus]</code>(Template-driven Forms)</td>\n<td>校验状态，可选：&#39;success&#39; &#39;warning&#39; &#39;error&#39; &#39;validating&#39;</td>\n<td>string</td>\n<td></td>\n</tr>\n<tr>\n<td><code>[nzHasFeedback]</code></td>\n<td>配合 nzValidateStatus 属性使用，展示校验状态图标</td>\n<td>boolean</td>\n<td>false</td>\n</tr>\n</tbody>\n</table>\n<h3 id=\"nz-form-explain\"><span>nz-form-explain</span><label class=\"api-type-label component\">component</label><a onclick=\"window.location.hash = 'nz-form-explain'\" class=\"anchor\">#</a></h3><p>用于显示提示信息，会自动根据当前的 nzValidateStatus 显示不同的颜色</p>\n<blockquote>\n<p>注意：每个 <code>nz-form-item</code> 下最多只能有一个 <code>nz-form-explain</code> 。</p>\n</blockquote>\n<h3 id=\"nz-form-extra\"><span>nz-form-extra</span><label class=\"api-type-label component\">component</label><a onclick=\"window.location.hash = 'nz-form-extra'\" class=\"anchor\">#</a></h3><p>用于显示表单额外提示信息</p>\n<h3 id=\"nz-form-split\"><span>nz-form-split</span><label class=\"api-type-label component\">component</label><a onclick=\"window.location.hash = 'nz-form-split'\" class=\"anchor\">#</a></h3><p>用于显示分隔符 <code>-</code></p>\n<h3 id=\"nz-form-text\"><span>nz-form-text</span><label class=\"api-type-label component\">component</label><a onclick=\"window.location.hash = 'nz-form-text'\" class=\"anchor\">#</a></h3><p>在 <code>nz-form-control</code> 中直接显示文本</p>\n</section></article>"

